import React from "react";

const url = "https://image.tmdb.org/t/p/w500/A0knvX7rlwTyZSKj8H5NiARb45.jpg";

export const Card_Movie = ({
  title,
  release_date,
  vote_average,
  poster_path,
}) => {
  return (
    <div className="w-48 mx-5 inline-block">
      <div>
        <img
          src={`https://image.tmdb.org/t/p/w500${poster_path}`}
          alt="poster"
          className="rounded-lg cursor-pointer shadow-lg"
        />
      </div>

      <div className="p-2">
        <h3 className="">{title}</h3>
        <p className="">{release_date}</p>
        <p className="">{vote_average}</p>
      </div>
    </div>
  );
};

export default Card_Movie;
